css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document url-prefix("http://images.google.com/images"), url-prefix("http://www.google.com/images"),
               url-prefix("http://images.google.co.jp/images"), url-prefix("http://www.google.co.jp/images"),
               url-prefix("http://images.google.de/images"), url-prefix("http://www.google.de/images"),
               /* Lightbox page */
               url-prefix("http://images.google.com/imgres"), url-prefix("http://www.google.com/imgres"),
               url-prefix("http://images.google.co.jp/imgres"), url-prefix("http://www.google.co.jp/imgres"),
               url-prefix("http://images.google.de/imgres"), url-prefix("http://www.google.de/imgres") {

/* Other Selection */
button::-moz-focus-inner, input[type="submit"]::-moz-focus-inner {border:0px;}
::-moz-selection {background:#888; color:#222;}
body, td, div, .p, a {font-family: Lucida Grande, Helvetica, Tahoma, arial, sans-serif !important;}
body {background:#373737 !important;}

/* gbar */
#gog {background:-moz-linear-gradient(top, #2F3236, #363A3D 20%, #32363A 50%, #2B2E30 80%, #282B2E) !important; height:23px; margin-top:-3px; border-bottom:1px solid #595959;}
#gbar, #guser {font-size:10px !important; padding-top:5px !important; color:#CCC !important;}
a.gb1, a.gb2, a.gb3, a.gb4 {color: #999 !important;}
a.gb1:hover, a.gb2:hover, a.gb3:hover, a.gb4:hover {color: #FFF !important;}
.gb3 u, .osl a:hover, .gl a:hover, #tsf a:hover, a.mblink:hover, a.gl:hover, a.fl:hover, .slk a:hover, .bc a:hover, .flt:hover, a.flt:hover u, .oslk a:hover, .tbotu:hover {text-decoration:none !important;}
.gbh, .gbd {border:none !important;}

/* More Dropdown */
div#gbi, div#gbg {border-color:#444 !important; -moz-border-radius: 6px;}
#gbs, .gbm {background:rgba(40,40,40, 0.95)!important; -moz-border-radius: 6px; -moz-box-shadow: 2px 2px 4px rgba(0,0,0, 0.3);}
div#gbi a.gb2:hover, div#gbg a.gb2:hover, .mi:hover {background-color:#697591 !important;}

/* Logo */
#logo {visibility: hidden !important;}
#logo:before {content: url(data:image/png;base64,); visibility: visible;}

/* Search bar */
.tsf-p {margin-left:176px !important;}
.lst-td, div.tsf-p > table {border:none !important;}
.lst {background:-moz-linear-gradient(top, #424242, #535353) !important; -moz-appearance: none !important; border: 1px solid #595959 !important; color: #CCC !important; -moz-box-shadow: #000 0 0 1px;
-moz-border-radius-topleft:3px; -moz-border-radius-bottomleft:3px; padding:1px !important;
font-size: 13px !important; width:250px !important; height:18px !important;}

/* Search button */
.ds {border-right:none !important; height:24px !important;}
.lst-td {width:254px !important; padding-right:1px !important;}
.lsbb {background:none repeat scroll 0 0 #3F3F3F !important; border-color:#2B2B2B #1B1B1B #1B1B1B #2B2B2B !important; border-right:1px solid #1B1B1B !important;
height:22px !important; -moz-border-radius-topright:3px; -moz-border-radius-bottomright:3px;}
.lsb {background:-moz-linear-gradient(top, #3F3F3F, #363636) !important; border-top:1px solid #525252 !important;
color:#999 !important; font-size:11px !important; text-shadow:0 -1px 0 #111 !important; height:22px !important; -moz-border-radius-topright:3px; -moz-border-radius-bottomright:3px;}
.lsb:active {background:-moz-linear-gradient(top, #363636, #484848) !important;}

/* Suggest Dropdown */
.gac_od {background:rgba(20,20,20, 0.95)!important; border:none !important;
-moz-border-radius-bottomleft:5px; -moz-border-radius-bottomright:5px; -moz-box-shadow:2px 2px 8px rgba(0,0,0, 0.6);}
.gac_id {background:none !important; border:1px solid #2F2F2F !important;
-moz-border-radius-bottomleft:5px; -moz-border-radius-bottomright:5px;}
.gac_m {background:none !important; color:#CCC !important; font-size:14px !important;}
.gac_b td.gac_c, .gac_b {background:none repeat scroll 0 0 #555 !important; color:#FFF !important; opacity:0.9}
a.fl:link, .fl a, .flt, a.flt, .gl a:link, a.mblink, .mblink b {color: #697591 !important;}

/* Result Stats */
a.gl, a.flt u, a.flt small, #resultStats {color:#999 !important; font-size:10px !important; text-shadow:0 -1px 0 #111;}
a.gl {position:absolute !important; top:18px; left:500px;}
#subform_ctrl {padding-top:0 !important; margin-top:-3px !important;}

/* Safe Search Dropdown */
.lsd {top:10px !important;}
#ss-status {float:right !important; font-size:10px !important;}
#ss-box {background:rgba(40,40,40, 0.9)!important; border-color:#444 !important; -moz-border-radius: 6px; -moz-box-shadow: 2px 2px 4px rgba(0,0,0, 0.6);}
#ss-barframe {background:none !important;}
#ss-box a:hover {background-color:#697591 !important; color:#FFF !important;}
a.ss-selected {color:#DDD !important;}
a.ss-unselected {color:#999 !important;}

/* Result Color */
.std {color:#888 !important;}
li.g, body, html, .c h2, #mbEnd h2, h1 {font-size:8pt !important; line-height:13px !important;}
.a, cite, cite a:link, cite a:visited, .cite, .cite:link, #mbEnd cite b, #tads cite b, #ni {color: #697591 !important;}
cite a, a.pn, td.cur, div.med {color: #888 !important;}
div.eft a.fl, div.eft a {color: #888 !important; font-size:7pt !important;}

/* Result layout */
.lhshdr, .tpblk, .tphdr {background:none repeat scroll 0 0 transparent !important;}
.rshdr {background:none repeat scroll 0 0 transparent !important; width:70% !important;}
.tpblk {background:-moz-linear-gradient(top, #494949, #373737 40px, #373737) !important; top:24px !important;}
#rgsh_s {background:none !important; top:92px !important; width:100px !important; margin:0 !important;}
.rgsh, #rgsh_s {font-size:10px !important; text-shadow:0 -1px 0 #222;}
a#rg_hta, a.rg_hal {color:#697591 !important; font-size:90% !important;}
span#rg_hr, a#rg_hals.rg_hal {color:#777 !important;}
div#rg_hx.std {font-size:80% !important;}
div#rg_h.rg_hv {background:rgba(40,40,40, 0.9) !important; -moz-border-radius: 3px;}
.rg_l {background:none repeat scroll 0 0 #373737 !important;}
#tbbcc, #tbbc {background:none !important; text-align:right; top:92px !important;}
#tbbcs, #res.med div[style="overflow: hidden; width: 100%; height: 36px;"] {height:0 !important;}
#tbbc a {color: #697591 !important;}
#tbbc .close_btn {background:url(data:image/png;base64,)no-repeat !important; background-position:0 0 !important; margin:-1px 0 0 10px;}

/* Left Nav */
#ms, li#lr_.tbos, li#lr_lang_1ja.tbou, #leftnav h2, ul#swr {display:none !important;}
nobr.tbpc, nobr.tbpo {color:#555 !important;}
#center_col {border-left:2px solid !important; -moz-border-left-colors: #222 #444;}
a#showmodes.jsb {border:none !important;}
#tbd, #hidden_modes {background:none !important;}
#leftnav {background:transparent !important;}
#leftnav a {color:#999 !important;}
.tbos {color:#BBB !important;}
.mitem, #showmodes {font-size:12px !important; padding-top:3px !important;}
.micon {margin-top:0 !important;}
#showmodes .micon {margin-top:5px !important;}
.tbt, .tbpo {font-size:11px !important;}

/* Any Color */
#sc-block .sc {background:none !important;}
#sc-block .sc a {border-color:#FFF !important;}
a#sl0, a#sl1, a#sl2, a#sl3, a#sl4, a#sl5, a#sl6, a#sl7, a#sl8, a#sl9, a#sl10, a#sl11 {opacity:0.5;}
a#sl0:hover, a#sl1:hover, a#sl2:hover, a#sl3:hover, a#sl4:hover, a#sl5:hover, a#sl6:hover, a#sl7:hover, a#sl8:hover, a#sl9:hover, a#sl10:hover, a#sl11:hover {opacity:1; border-color:#AAA !important;}

/* Swatch */
a#sl0 {background: -moz-linear-gradient(-90deg, #FF0000, #CC0000) !important;}
a#sl1 {background: -moz-linear-gradient(-90deg, #FFBD0E, #FB940B) !important;}
a#sl2 {background: -moz-linear-gradient(-90deg, #FFFF00, #D0D000) !important;}
a#sl3 {background: -moz-linear-gradient(-90deg, #00FF00, #00CC00) !important;}
a#sl4 {background: -moz-linear-gradient(-90deg, #02F6FF, #03C0C6) !important;}
a#sl5 {background: -moz-linear-gradient(-90deg, #1862FF, #0000FF) !important;}
a#sl6 {background: -moz-linear-gradient(-90deg, #AB3FF7, #762CA7) !important;}
a#sl7 {background: -moz-linear-gradient(-90deg, #FFC7DD, #FF98BF) !important;}
a#sl8 {background: -moz-linear-gradient(-90deg, #FFF, #CCC) !important;}
a#sl9 {background: -moz-linear-gradient(-90deg, #999, #777) !important;}
a#sl10 {background: -moz-linear-gradient(-90deg, #444, #000) !important;}
a#sl11 {background: -moz-linear-gradient(-90deg, #CC7E25, #885418) !important;}

/* Exactly */
input#iszw, input#iszh {background:#4C4C4C !important; border:1px solid #2B2B2B !important; color:#AAA !important; padding:1px !important; -moz-appearance: none !important; -moz-border-radius:3px !important;}
input#iszw:focus, input#iszh:focus {border:1px solid #7F7F7F !important;}
button#iszex_btn {color:#999 !important; cursor:pointer; -moz-appearance:none !important; text-shadow: 0 -1px 0 #222;
background:-moz-linear-gradient(-90deg, #545454, #3B3B3B) !important; -moz-border-radius:3px !important; border:1px solid #2B2B2B !important; min-height:18px !important;}
button#iszex_btn:active {color:#656565 !important; text-shadow:#000 0 -1px 0;
background:-moz-linear-gradient(-90deg, #353535, #3D3D3D)!important;}

/* Footer */
#smc.ds {border-bottom:none !important; }
#nav td {padding-right:5px !important;}
#nav td a.fl {color: #697591 !important;}
#ofr i {font-style: normal !important; font-size:x-small !important;}
#ofr i br {display:none !important;}

/* Hidden Stuff */
#fll a, p#bfl, .csb, #tads.c, #res p.std
{display:none !important;}

/* Lightbox page */
#il {background:none repeat scroll 0 0 #373737 !important;}
#il_m {background:-moz-linear-gradient(top, #525252, #373737 20px, #373737 50%, #282828) !important; color:#999 !important;}
#il_m img[src$="/images_logo_sm.gif"] {width:0 !important; height:0 !important; padding:0 0 30px 151px !important; background:url(data:image/png;base64,) no-repeat !important;}
#il_m a, #il_fc a {color:#697591 !important;}
#il_m .il_r {color:#777 !important;}
#il_fi {background:rgba(40,40,40, 0.4)!important; -moz-border-radius: 3px;}
#il .close_lk {background:transparent !important; padding:0 0 0 18px !important; margin-top:-12px;}
#il .close_btn {background:url(data:image/png;base64,)no-repeat !important; background-position:0 0 !important; height:26px !important; width:26px !important;}
}
